INSERT INTO `news` (`id`, `club_id`, `user_id`, `title`, `exerpt`, `content`, `tags`, `image`, `isPublised`, `created_at`, `updated_at`) VALUES
(15, 8, 35, 'Vi öppnar ett nytt padelcenter i Kungsbacka', 'It is not the same as \"back burning\", which is done as a last and sdfnw', '<section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\"><b>As Australia battles unprecedented fires this year</b>, a debate is under way about what is called \"controlled burning\" as a means to stop fires spreading.</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\">This involves deliberately starting fires under controlled conditions to clear out low-lying flammable material - sometimes called \"prescribed\" or \"hazard reduction burning\".</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\">It is not the same as \"back burning\", which is done as a last resort to try to slow down an approaching wildfire by stripping the ground of vegetation.</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\">Some politicians in Australia have blamed environmental activism for preventing controlled fires because of their impact on wildlife and fauna.</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec4\">\n            <div class=\"row justify-content-center\">\n                <div class=\"col-12 col-md-10 col-lg-8\">\n                    <div class=\"news_cmnt\">\n                        <blockquote>\n                            <span class=\"quote qute_lft\"><i class=\"fas fa-quote-left\"></i></span>\n                             So what is the truth behind these claims, and does controlled burning really work?\n                            <span class=\"quote qute_r8\"><i class=\"fas fa-quote-right\"></i></span>\n                        </blockquote>\n                        <p>- Fireman - Australia</p>\n                    </div>\n                </div>\n            </div>\n        </section>	<section class=\"nws3_sec4\">\n            <div class=\"row justify-content-center\">\n                <div class=\"col-12 col-md-10 col-lg-8\">\n        \n                    <div class=\"list_item_btm\">\n                            <div class=\"list_item_btm_img\">\n                                <img src=\"https://backoffice.kollol.me/uploads/BBaVDj2VIZGJSkpUGBP4ppJNmyUw7fA6B5uh5HZi.jpeg\" alt=\"\">\n                            </div>\n                            \n                        </div>\n        \n        \n                </div>\n            </div>\n        </section><section class=\"nws3_sec4\">\n            <div class=\"row justify-content-center\">\n                <div class=\"col-12 col-md-10 col-lg-8\">\n        \n                   <div class=\"nws3_sec_top\">\n                        <h2>What the hell is wrong with the world?</h2>\n                    </div>\n        \n        \n                </div>\n            </div>\n        </section>	<section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\">It is not the same as \"back burning\", which is done as a last resort to try to slow down an approaching wildfire by stripping the ground of vegetation.</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\">Some politicians in Australia have blamed environmental activism for preventing controlled fires because of their impact on wildlife and fauna.</p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec2\">\n			<div class=\"row justify-content-center\">\n				<div class=\"col-12 col-md-10 col-lg-8\">\n					<div class=\"nws3_text_all\">\n						<p class=\"nws3_text1\"><b>So what is the truth behind these claims, and does controlled burning really work?</b></p>\n					</div>\n				</div>\n			</div>\n		</section><section class=\"nws3_sec4\">\n            <div class=\"row justify-content-center\">\n                <div class=\"col-12 col-md-10 col-lg-8\">\n                    <div class=\"table_top_sec\">\n                        <div class=\"_1checkbox\">\n                <span class=\"_1checkbox_round\"></span>\n                one</div><div class=\"_1checkbox\">\n                <span class=\"_1checkbox_round\"></span>\n                two</div><div class=\"_1checkbox\">\n                <span class=\"_1checkbox_round\"></span>\n                three</div>\n                    </div>\n                </div>\n            </div>\n        </section>	<section class=\"nws3_sec4\">\n            <div class=\"row justify-content-center\">\n                <div class=\"col-12 col-md-10 col-lg-8\">\n        \n                    <div class=\"list_item_btm\">\n                            <div class=\"list_item_btm_img\">\n                            <iframe width=\"730\" height=\"415\" src=\"https://www.youtube.com/embed/1iVUUvdQmSQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n                            </div>\n                            \n                        </div>\n        \n        \n                </div>\n            </div>\n        </section>', '[{\"tag\":\"Fire\",\"id\":1},{\"tag\":\"HEDE\",\"id\":2}]', 'https://backoffice.kollol.me/uploads/hjVS27MTLjKtAvj1AUi7oSGqBEVaoRsFC3eqnke4.jpeg', '', '2020-01-09 15:06:03', '2020-01-09 15:06:03'),
